import React from "react";
import MarkListTable from "components/tables/MarkListTable";
export default function ExamMarkList(props) {
    const remoteData = async () =>{
      try {
        setLoading(true);
        const response = await api.post("/admin/getExamStudentMarks", { examId:props.match.params.id }, {
          headers: {
            Authorization: `Bearer ${getCredentials()}`,
            "Content-Type": "application/json",
          },
        },
          { timeout: 1000 }
        );
  
        console.log("STUD DETAILD ", response.data.response);
        setData(response.data.response);
        setLoading(false);
      } catch (error) {
        console.log(error);
        setLoading(false);
      }
    }
  return (
    <div>
      <MarkListTable
        data={data}
        examId={props.match.params.id}
        history={props.history}
        remoteData={remoteData}
        isStudentTable={false}
      />
    </div>
  );
}
